import { GoogleLogin } from '@react-oauth/google'
import { useState } from 'react'

export default function Logon() {
	const [showLogin, setShowLogin] = useState(false)

	const responseSucess = async response => {
		response

		const userData = {
			sub: response.profileObj.googleId,
			email: response.profileObj.email,
			given_name: response.profileObj.givenName,
			family_name: response.profileObj.familyName,
			picture: response.profileObj.imageUrl,
		}

		const res = await fetch('http://localhost:4000/api/google-login', {
			method: 'POST',
			headers: {
				'Content-Type': 'application/json',
			},
			body: JSON.stringify(userData),
		})
	}
	const responseFailure = () => {
		console.log('login is not successful')
	}

	return (
		<div className='App'>
			{!showLogin && (
				<GoogleLogin
					clientId='500804855419-pms6km4isevbtq88rpgbpp02tdjq26fm.apps.googleusercontent.com'
					onSuccess={responseSucess}
					onFailure={responseFailure}
				/>
			)}
		</div>
	)
}
